import React from "react";
import ReactDOM from "react-dom";
import comp, { facebook, pubg, Check, Timerr, perfect } from "./App";
import pic from "./images/cricket.mp4";
import "./index.css";

ReactDOM.render(
  <>
    {perfect()}
    {perfect()}
    {perfect()}
    {perfect()}
    {perfect()}
  </>,
  document.getElementById("root")
);
